import { React, Link } from "react";
import {Logout} from "../components/Logout";
const UserDashboard = () => {
  return (
    <div>
      <h1>User dashboard</h1>
      <Link
        to="/logout"
        className="px-4 py-2 bg-red-500 text-white rounded hover:bg-red-600"
      >
        Logout
      </Link>
    </div>
  );
};

export default UserDashboard;
